import React from 'react';
import { Modal, Button, Form } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

export default function SettingsModal({show ,handleCloseModal}) {
    return (
      <Modal
        show={show}
        size="lg"
        aria-labelledby="contained-modal-title-vcenter"
        top>
        <Modal.Header closeButton>
          <Modal.Title id="contained-modal-title-vcenter">
            Game Settings
          </Modal.Title>
        </Modal.Header>
        <Modal.Body>
          {/* Computer Settings */}
          <Form>
            <div key={`inline-radio`} className="mb-3">
                {'Computer: '}
                <Form.Check inline label="Random" type={'radio'} id={`inline-${'radio'}-1`} />
                <Form.Check inline label="AI" type={'radio'} id={`inline-${'radio'}-2`} />
                </div>
            </Form>
        </Modal.Body>
        <Modal.Footer>
          <Button onClick={handleCloseModal}>Close</Button>
          <Button onClick={handleCloseModal}>Save</Button>
        </Modal.Footer>
      </Modal>
    );
  }
